import React from 'react'

const Social = () => {
  return (
    <div className="home__social">
        <a href="https://www.instagram.com" className="home__social-icon" target="_blank"><i class="uil uil-instagram"></i></a>

        <a href="https://www.facebook.com" className="home__social-icon" target="_blank"><i class="uil uil-facebook-f"></i></a>

        <a href="https://www.github.com" className="home__social-icon" target="_blank"><i class="uil uil-github-alt"></i></a>
    </div>
  )
}

export default Social
